import React from 'react';
import './app.css';
import Header from '../header/header';
import Navbar from '../nav-bar';
import Profile from '../profile';


const App = () => {
  return (
    <div className='app-wrapper'> 
    <Header />
    <Navbar />
    <Profile /> 
    </div>
  );
}

export default App;
